import React from 'react';
import {Github, Instagram,Facebook, Linkedin, Envelope} from 'react-bootstrap-icons';

const Leftnavbar=()=>{

    return(
        <React.Fragment>
            <div className='leftbar'>
                <ul>
                    <li><a href="https://www.w3schools.com/w3css/w3css_animate.asp" target="_blank"><Facebook /></a></li>
                    <li><Linkedin/></li>
                    <li><Instagram/></li>
                    <li><Github /></li>
                </ul>
            </div>
            

        </React.Fragment>
    )

};

export default Leftnavbar;
